import React from "react";

const Header = ({ logo, title, navLinks, rightContent }) => (
  <header className="flex items-center justify-between whitespace-nowrap border-b border-solid border-b-[#2b3640] px-10 py-3">
    <div className="flex items-center gap-4 text-white">
      <div>{logo || <img src="/logo.png" alt="Starbuilder Logo" className="w-[120px] h-full object-contain" />}</div>
      <h2 className="text-white text-lg font-bold leading-tight tracking-[-0.015em]">{title}</h2>
    </div>
    <div className="flex flex-1 justify-end gap-8">
      <div className="flex items-center gap-9">
        {navLinks && navLinks.map((link, idx) => (
          <a key={idx} className="text-white text-sm font-medium leading-normal" href={link.href}>{link.label}</a>
        ))}
      </div>
      {rightContent && <div>{rightContent}</div>}
    </div>
  </header>
);

export default Header;
